import React from 'react';
import { Link } from 'react-router-dom';

class Authentication extends React.Component {
    
    render() {

        const loginView = (
            <div>
                <div className="card-content">
                    <div className="row">
                        <div className="input-field col s12 usercode">
                            <label>Username</label>
                            <input name="usercode" type="text" className="validate" />
                            <a className="waves-effect waves-light btn">Login</a>
                        </div>
                    </div>
                </div>
            </div>
        );

        return (
            <div className="container auth">
                <Link className="logo" to="/"><img src="" />logo</Link>
                <div className="card login-wrap">
                    <div className="header red white-text center">
                        <div className="card-content">{ this.props.loginView }</div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Authentication;
